def solve():
    n, m = map(int, input().split())
    edges = []
    for _ in range(m):
        u, v = map(int, input().split())
        edges.append((u, v))

    count = 0
    for i in range(2**m):
        subset = []
        for j in range(m):
            if (i >> j) & 1:
                subset.append(edges[j])

        adj = [[] for _ in range(n + 1)]
        for u, v in edges:
            if (u,v) not in subset:
                adj[u].append(v)

        def winning(curr_pos):


            q = [curr_pos]
            visited = set()
            turn = 0 

            while q:
                curr = q.pop(0)
                visited.add(curr)

                can_move = False
                for u, v in edges:
                    if (u,v) not in subset:
                        if u in curr and v not in curr:
                            can_move = True
                            next_pos = tuple(sorted(list(set(curr) - {u} | {v})))

                            if next_pos not in visited:
                                q.append(next_pos)

                if not can_move:
                    return (turn+1)%2 ==1 
                turn+=1
            return False

        if winning((1,2)):
            count += 1

    print(count)

